# Berita

INSERT INTO
    `beritas` (
        `id`,
        `judul`,
        `berita`,
        `gambar`,
        `users_id`,
        `category_id`,
        `created_at`,
        `updated_at`
    )
VALUES (
        1,
        '23 Pengajuan Penghentian Penuntutan Berdasarkan Restorative Justice Disetujui oleh JAM-Pidum',
        'Jaksa Agung RI kembali melakukan penghentian penuntutan berdasarkan keadilan restoratif melalui Jaksa Agung Muda Tindak Pidana Umum (JAM-Pidum) Dr. Fadil Zumhana. Dimana penghentian penuntutan berdasarkan keadilan restoratif yang telah disetujui pada hari Kamis(20/07/2023), sebanyak 17 permohonan penghentian penuntutan berdasarkan keadilan restoratif.\r\n\r\nJAM Pidum menjelaskan bahwasannya 17 permohonan penghentian penuntutan berdasarkan keadilan restoratif dengan Tersangka yang terlibat didalamnya yaitu diantaranya:\r\n\r\nTersangka YULI SUDARWANTO bin DARISALAM dari Kejaksaan Negeri Klaten, yang disangka melanggar Pasal 351 Ayat (1) KUHP tentang Penganiayaan.\r\nTersangka REZA ARIZENDA bin AMIR MAHMUD dari Kejaksaan Negeri Kota Semarang, yang disangka melanggar Pasal 362 KUHP tentang Pencurian.\r\nTersangka RADITYA YOGA DITAMA bin ARIF HAMDI HAITO (Alm) dari Kejaksaan Negeri Surakarta, yang disangka melanggar Pasal 351 Ayat (1) KUHP tentang Penganiayaan.  \r\nTersangka BAMBANG SUPARDI bin WASIR (Alm) dari Kejaksaan Negeri Bengkulu Tengah, yang disangka melanggar Pasal 44 Ayat (1) atau Ayat (4) Undang-Undang RI Nomor 23 Tahun 2004 tentang Penghapusan Kekerasan Dalam Rumah Tangga.\r\nTersangka ABDUL RAHMAN WAHID SIREGAR dari Kejaksaan Negeri Padang Sidempuan, yang disangka melanggar Pasal 351 Ayat (1) KUHP tentang Penganiayaan.\r\nTersangka ALDI SALOMO SIANTURI als ALDI dari Kejaksaan Negeri Langkat, yang disangka melanggar Pasal 310 Ayat (4) dan Ayat (3) Undang-Undang RI Nomor 22 Tahun 2009 tentang Lalu Lintas dan Angkutan Jalan.\r\nTersangka MUHAMMAD RIZKY FADHILLAH dari Kejaksaan Negeri Belawan, yang disangka melanggar Pasal 372 KUHP tentang Penggelapan atau Pasal 378 KUHP tentang Penipuan.\r\nTersangka ARI WIBOWO als BOWO dari Kejaksaan Negeri Belawan, yang disangka melanggar Pasal 480 ke-1 Subsidair Pasal 480 ke-2 KUHP tentang Penadahan.\r\nTersangka MUHAMMAD JUNAINDRI als ANDRI dari Kejaksaan Negeri Belawan, yang disangka melanggar Pasal 44 Ayat (1) Undang-Undang RI Nomor 23 Tahun 2004 tentang Penghapusan Kekerasan Dalam Rumah Tangga.\r\nTersangka MUHAMMAD ILHAM bin HAMDANI UMAR dari Kejaksaan Negeri Bireuen, yang disangka melanggar Pasal 362 KUHP tentang Pencurian.\r\nTersangka MUHAMMAD TAUFIK bin MUSA IDRIS dari Kejaksaan Negeri Bireuen, yang disangka melanggar Pasal 351 Ayat (1) KUHP tentang Penganiayaan.\r\nTersangka YUSMADI IS bin alm ISMAIL dari Kejaksaan Negeri Aceh Besar, yang disangka melanggar Pasal 351 Ayat (1) KUHP tentang Penganiayaan.\r\nTersangka INDRA bin Alm YAKUB dari Kejaksaan Negeri Aceh Besar, yang disangka melanggar Pasal 351 Ayat (1) KUHP tentang Penganiayaan.\r\nTersangka ZULKIFLI als SIDUN bin KAMARUDDIN dari Kejaksaan Negeri Nagan Raya, yang disangka melanggar Pasal 335 Ayat (1) ke-1 KUHP tentang Pengancaman.\r\nTersangka RUSLI AD bin Alm ABDULLAH dari Kejaksaan Negeri Langsa, yang disangka melanggar Pasal 480 Ayat (1) KUHP tentang Penadahan.\r\nTersangka IMANULLOH bin SAWALUDIN dari Kejaksaan Negeri Lombok Timur, yang disangka melanggar Pasal 310 Ayat (3) atau Ayat (1) Undang-Undang RI Nomor 22 Tahun 2009 tentang Lalu Lintas dan Angkutan Jalan.\r\nTersangka SAMSUL HADI bin (Alm.) KHADIST dari Kejaksaan Negeri Tarakan, yang disangka melanggar Pasal 362 KUHP tentang Pencurian.\r\nTersangka HARIADI PRASETYO alias TIO bin TRUBUS dari Kejaksaan Negeri Tarakan, yang disangka melanggar Pasal 351 Ayat (1) KUHP tentang Penganiayaan.\r\nTersangka JUNARDI alias LEK JERET bin TUKIRAN dari Cabang Kejaksaan Negeri Batanghari di Muara Tembesi, yang disangka melanggar Pasal 335 Ayat (1) ke-1 KUHP tentang Pengancaman.\r\nTersangka FIJAI TAMHER alias FIJAY alias AI dari Kejaksaan Negeri Tual, yang disangka melanggar Pasal 351 Ayat (1) KUHP tentang Penganiayaan.\r\nTersangka FRENGKI NGURMETAN dari Kejaksaan Negeri Tual, yang disangka melanggar Pasal 351 Ayat (1) KUHP tentang Penganiayaan.\r\nTersangka ZAINAL ABIDIN RENNGUR alias JANTER dari Kejaksaan Negeri Tual, yang disangka melanggar Pasal 351 Ayat (1) KUHP tentang Penganiayaan.\r\nTersangka MUHAMMAD YUSUF IHA dari Kejaksaan Negeri Fakfak, yang disangka melanggar Pasal 76C jo. Pasal 80 Ayat (1) Undang-Undang RI Nomor 35 Tahun 2014 tentang Perubahan Kedua atas Undang-Undang RI Nomor 23 Tahun 2002 tentang Perlindungan Anak atau Pasal 351 Ayat (1) KUHP tentang Penganiayaan.\r\n\"Selanjutnya, saya memerintahkan kepada Para Kepala Kejaksaan Negeri untuk menerbitkan Surat Ketetapan Penghentian Penuntutan (SKP2) Berdasarkan Keadilan Restoratif sesuai Peraturan Kejaksaan Republik Indonesia Nomor 15 Tahun 2020 dan Surat Edaran JAM-Pidum Nomor: 01/E/EJP/02/2022 tanggal 10 Februari 2022 tentang Pelaksanaan Penghentian Penuntutan Berdasarkan Keadilan Restoratif sebagai perwujudan kepastian hukum.\", jelas JAM-Pidum. Kamis(20/07)',
        '20230721102351.jpg',
        3,
        1,
        '2023-07-20 20:23:53',
        '2023-07-20 20:23:53'
    ), (
        2,
        '7 Orang Diperiksa Sebagai Saksi, Terkait Dengan Perkara BAKTI Kementerian Komunikasi dan Informatika Dalam Perkara TPPU',
        'Kejaksaan Agung kembali melakukan pemeriksaan terkait dengan perkara dugaan tindak pidana pencucian uang dengan tindak pidana asal tindak pidana korupsi dalam penyediaan infrastruktur Base Transceiver Station (BTS) 4G dan infrastruktur pendukung paket 1, 2, 3, 4, dan 5 BAKTI Kementerian Komunikasi dan Informatika Tahun 2020 s/d 2022. Pemeriksaan terkait dengan perkara dugaan tindak pidana korupsi tersebut dilakukan melalui Tim Jaksa Penyidik pada Direktorat Penyidikan Jaksa Agung Muda Bidang Tindak Pidana Khusus (JAM PIDSUS).\r\n\r\nKapuspenkum menjelaskan bahwa ketujuh orang saksi yang diperiksa pada hari ini Selasa(11/07/2023) atas perkara dugaan tindak pidana korupsi dalam terkait dengan perkara dugaan tindak pidana pencucian uang dengan tindak pidana asal tindak pidana korupsi dalam penyediaan infrastruktur Base Transceiver Station (BTS) 4G beserta dengan infrastruktur pendukungnya tersebut yaitu berinisial atas nama S, W, Y, DPF, S, B, GTHS.\r\n\r\n\"Para saksi yang dilakukan pemeriksaan pada hari ini terkait dengan tindak pidana asal tindak pidana korupsi dalam penyediaan infrastruktur Base Transceiver Station (BTS) 4G dan infrastruktur pendukung paket 1, 2, 3, 4, dan 5 BAKTI Kementerian Komunikasi dan Informatika Tahun 2020 s/d 2022 sebanyak 3 orang saksi yaitu diantaranya saksi berinisial atas nama S selaku Direktur PT Indo Electric Instruments, W selaku Direktur PT Excelsia Mitraniaga Mandiri, Y selaku Karyawan PT Sansaine Exindo, DPF selaku Bagian Keuangan Project PT LEN Telekomunikasi Indonesia, S selaku Karyawan PT Sansaine Exindo, B selaku Karyawan PT Sansaine Exindo, serta GTHS selaku Project Director Consultant Office.\", Kamis(20/07)\r\n\r\nKapuspenkum menjelaskan bahwasaannya keempat orang yang telah diperiksa sebagai saksi tersebut, dilakukan untuk penyidikan terkait dengan perkara dugaan tindak pidana pencucian uang dengan tindak pidana asal tindak pidana korupsi yang telah dilakukan oleh tersangka berinisial atas nama Tersangka YUS dan sedangkan terkait dengan perkara dugaan tindak pidana korupsi (TPK) dan tersangka berinisial atas nama  Tersangka WP, dalam penyediaan infrastruktur Base Transceiver Station (BTS) 4G dan infrastruktur pendukung paket 1, 2, 3, 4, dan 5 BAKTI Kementerian Komunikasi dan Informatika Tahun 2020 s/d 2022',
        '20230721102447.jpg',
        3,
        1,
        '2023-07-20 20:24:50',
        '2023-07-20 20:24:50'
    ), (
        3,
        '2 Orang Diperiksa Sebagai Saksi, Terkait Dengan Perkara Komoditi Emas',
        'Kejaksaan Agung kembali melakukan pemeriksaan terkait dengan perkara dugaan tindak pidana korupsi pada pengelolaan kegiatan usaha komoditi emas tahun 2010 s/d 2022. Pemeriksaan terkait dengan perkara dugaan tindak pidana korupsi tersebut dilakukan Tim Jaksa Penyidik pada Direktorat Penyidikan Jaksa Agung Muda Bidang Tindak Pidana Khusus (JAM PIDSUS).\r\n\r\nTim Penyidik menjelaskan bahwa Saksi yang dilakukan pemeriksaan pada hari ini Kamis(20/07/2023) sebanyak 2 orang saksi yaitu saksi berinisial DS dan LO. \r\n\r\n\"Para saksi yang dilakukan pemeriksaan pada hari ini terkait dengan perkara dugaan tindak pidana korupsi tersebut yaitu saksi berinisial atas nama DS selaku Direktur Keuangan PT Nusa Halmahera Minerals da saksi berinisial LO selaku Direktur PT Hartono Wira Tanik.\",ujar Tim Penyidik. Kamis(20/07)\r\n\r\nTim Penyidik menambahkan bahwasaannya lima orang yang telah diperiksa sebagai saksi tersebut, dilakukan untuk penyidikan tindak pidana korupsi pada pengelolaan kegiatan usaha komoditi emas tahun 2010 s/d 2022.',
        '20230721102531.jpg',
        3,
        2,
        '2023-07-20 20:25:32',
        '2023-07-20 20:25:32'
    ), (
        4,
        '2 Orang Diperiksa Sebagai Saksi, Terkait Dengan Perkara Tol Japek',
        'Kejaksaan Agung kembali melakukan pemeriksaan terkait dengan perkara dugaan tindak pidana korupsi pada pekerjaan pembangunan (design and build) Jalan Tol Jakarta-Cikampek II Elevated Ruas Cikunir-Karawang Barat termasuk on/off ramp pada Simpang Susun Cikunir dan Karawang Barat. Pemeriksaan terkait dengan perkara dugaan tindak pidana korupsi tersebut dilakukan melalui Tim Jaksa Penyidik pada Direktorat Penyidikan Jaksa Agung Muda Bidang Tindak Pidana Khusus (JAM PIDSUS).\r\n\r\nTim Penyidik menjelaskan bahwa Saksi yang dilakukan pemeriksaan terkait kasus tersebut dilakukan dengan memeriksa 2 orang sebagai saksi pada hari Kamis(20/07/2023) yaitu Saksi yang merupakan Direktur Jenderal Perhubungan Darat pada periode 2019 serta Direktur Pengembangan Jasa Marga.\r\n\r\n\"Saksi yang dilakukan pemeriksaan pada hari ini yaitu saksi berinisial atas nama BS selaku Direktur Jenderal Perhubungan Darat periode 2019 dan saksi berinisial AI selaku Direktur Pengembangan Jasa Marga.\", jelas Tim Penyidik.\r\n\r\nTim Penyidik menambahkan bahwasaannya satu orang yang telah diperiksa sebagai saksi tersebut, dilakukan untuk penyidikan terkait penyidikan perkara dugaan tindak pidana korupsi pada pekerjaan pembangunan (design and build) Jalan Tol Jakarta-Cikampek II Elevated Ruas Cikunir-Karawang Barat termasuk on/off ramp pada Simpang Susun Cikunir dan Karawang Barat.',
        '20230721102629.jpg',
        3,
        2,
        '2023-07-20 20:26:31',
        '2023-07-20 20:26:31'
    ), (
        5,
        '1 Orang Diperiksa Sebagai Saksi, Terkait Dengan Perkara Ekspor Crude Palm Oil (CPO) dan Turunannya',
        'Kejaksaan Agung kembali melakukan pemeriksaan terkait dengan perkara dugaan tindak pidana korupsi dalam pemberian fasilitas ekspor Crude Palm Oil (CPO) dan turunannya pada industri kelapa sawit dalam Januari 2022 s/d April 2022. Pemeriksaan terkait dengan perkara dugaan tindak pidana korupsi tersebut dilakukan  melalui Tim Jaksa Penyidik pada Direktorat Penyidikan Jaksa Agung Muda Bidang Tindak Pidana Khusus (JAM PIDSUS).\r\n\r\nKepala Pusat Penerangan Hukum Dr. Ketut Sumedana menjelaskan dalam rilisnya. Dimana dalam rilis yang diterbitkan pada hari ini dijelaskan terkait dengan saksi yang diperiksa terkait dengan perkara dugaan tindak pidana korupsi tersebut, dimana pemeriksaan yang dilakukan terhadap 1 orang yang diperiksa sebagai saksi atas perkara tersebut.\r\n\r\nTim Penyidik menjelaskan bahwa keenam orang saksi yang diperiksa pada hari ini Kamis(20/07/2023) atas perkara dugaan tindak pidana korupsi dalam pemberian fasilitas ekspor Crude Palm Oil (CPO) dan turunannya  tersebut yaitu berinisial atas nama VBS.',
        '20230721102732.jpg',
        3,
        1,
        '2023-07-20 20:27:35',
        '2023-07-20 20:27:35'
    ), (
        6,
        'Peringatan HBA dan HUT IAD Tahun 2023, Kejari Mabar Gelar Baksos Bagi Sembako',
        'Hari Kamis, tanggal 14 Juli 2022 pukul 09.00 WIB S/d Selesai, Dalam rangka memperingati Hari Bhakti Adhyaksa ke-63 dan HUT Ikatan Adhyaksa Dharmakarini (IAD) KE-23 Kejaksaan Negeri Manggarai Barat melaksanakan kegiatan Bakti Sosial Berbagi Sembako oleh Kejaksaan Negeri Manggarai Barat dan Ikatan Adhyaksa Dharmakarini (IAD) Daerah Manggarai Barat di beberapa Yayasan dan Pondok Pesantren di Kabupaten Manggarai Barat.\r\n\r\nSebagai wujud nyata rasa kepedulian dan kecintaan kepada adik-adik yayasan dan pondok pesantren, selain membagikan paket sembako untuk sejumlah lokasi tersebut, pihaknya juga akan membagikan paket sembako untuk pegawai pramubakti Kejaksaan Negeri Manggarai Barat\r\n\r\nAdapun barang yang telah disiapkan dalam kegiatan bakti sosial kali ini berupa sembako yaitu berupa beras, mie instan, minyak goreng, susu, gula, dll. Rombongan Kejaksaan Negeri Manggarai Barat dan Ibu-ibu IAD Daerah Manggarai Barat sempat berinteraksi secara langsung dengan mereka. Melihat anak-anak yang tetap tersenyum dan antusias menyambut rombongan, anggota rombongan pun sangat senang sekaligus bangga.',
        '20230721102811.jpg',
        3,
        2,
        '2023-07-20 20:28:23',
        '2023-07-20 20:28:23'
    ), (
        7,
        '1 Orang Ditetapkan Sebagai Tersangka dalam Perkara Pertambangan Ori Nikel',
        '1 orang ditetapkan sebagai TERSANGKA oleh Tim Penyidik pada Kejaksaan Tinggi Sulawesi Tenggara serta dilakukan penahanan terhadap yang bersangkutan terkait dengan perkara dugaan tindak pidana korupsi pertambangan ore nikel di wilayah Izin Usaha Pertambangan (IUP) PT Antam di Blok Mandiodo, Konawe Utara, Sulawesi Tenggara.\r\n\r\nTim Penyidik menjelaskan bahwasannya satu orang yang ditetapkan sebagai tersangka dan dilakukan penahanan pada hari ini Selasa(18/07/2023) bertempat di Gedung Bundar Kejaksaan Agung yaitu tersangka berinisial atas nama WAS yang merupakan Pemilik PT Lawu Agung Mining.\r\n\r\n\"Tersangka WAS akan kami titipkan untuk dilakukan penahanan di Rumah Tahanan Negara Salemba Cabang Kejaksaan Agung. Kemudian dalam waktu dekat, penahanan akan dipindahkan ke Kendari, Sulawesi Tenggara untuk dilakukan penyidikan.\", ujar Tim Penyidik pada Kejaksaan Tinggi Sulawesi Tenggara.\r\n\r\nTim Penyidik juga menjelaskan secara singkat terkait dengan kasus posisi dalam perkara ini yaitu bermula dari adanya Kerja Sama Operasional (KSO) antara PT Antam dengan PT Lawu Agung Mining serta Perusahaan Daerah Sulawesi Tenggara atau Perusahaan Daerah Konawe Utara.\r\n\r\n\"Tersangka WAS selaku pemilik PT Lawu Agung Mining adalah pihak yang mendapat keuntungan dari tindak pidana korupsi pertambangan nikel.\", ujar Tim Penyidik. Selasa(18/07)',
        '20230721103503.jpg',
